import React, {useState} from 'react'
import Chat from './components/Chat';
import Room from './components/Room';
import './App.css';


function App(){
  const [roomId,setRoomId] = useState('');
  return (
    <div className="App">
      {roomId !== '' ? 
      <Chat roomId={roomId} setRoomId={setRoomId}/>
      : <Room setRoomId={setRoomId}/>}
    </div>
  )
}

export default App
